import {Router} from "express";
import { methods as loginController } from "../controllers/administradores.controller";

const router = Router();

//rutas del modulo login
router.get("/", loginController.getPersonasAdm);
router.get("/:id", loginController.getPersonaAdm);
router.post("/", loginController.addPersonaAdm);
router.put("/:id", loginController.updatePersonaAdm);
router.delete("/:id", loginController.deleteLoginAdm);

router.get("/", loginController.getPersonasVol);
router.get("/:id", loginController.getPersonaVol);
router.post("/", loginController.addPersonaVol);
router.put("/:id", loginController.updatePersonaVol);
router.delete("/:id", loginController.deleteLoginVol);

export default router;

