import {getConnection} from "../../database/database";

//metodos para los voluntarios del albergue


const getPersonasVol = async (req, res) => {
    try {
        const connection= await getConnection();
        const result = await connection.query("SELECT id_persona, nombre, apellido, edad, grado_academico, telefono, direccion FROM bd_animals.persona WHERE rol = 'Voluntario';");
        res.json(result);
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }

};

