        const { id } = req.params;
        const connection= await getConnection();
        const result = await connection.query("SELECT id_persona, nombre, apellido, edad, grado_academico, telefono, direccion FROM bd_animals.persona WHERE rol = 'Voluntario' AND id_persona = ?", id);
        res.json(result);
